obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"1584954","type":"CustomJS"},{"attributes":{},"id":"1584888","type":"AllLabels"},{"attributes":{"coordinates":null,"group":null},"id":"1584882","type":"Title"},{"attributes":{"axis":{"id":"1584906"},"coordinates":null,"group":null,"ticker":null},"id":"1584909","type":"Grid"},{"attributes":{"line_alpha":{"value":0.2},"line_color":{"value":"#bbbbbb"},"x0":{"field":"index"},"x1":{"field":"index"},"y0":{"field":"High"},"y1":{"field":"Low"}},"id":"1584854","type":"Segment"},{"attributes":{"border_line_color":"#333333","click_policy":"hide","coordinates":null,"glyph_width":0,"group":null,"items":[{"id":"1584948"}],"label_text_font_size":"8pt","location":"top_left","margin":0,"padding":5,"spacing":0},"id":"1584947","type":"Legend"},{"attributes":{"coordinates":null,"formatter":{"id":"1584805"},"group":null,"major_label_policy":{"id":"1584982"},"ticker":{"id":"1584816"},"visible":true},"id":"1584815","type":"LinearAxis"},{"attributes":{},"id":"1584809","type":"DataRange1d"},{"attributes":{"data":{"Close":{"__ndarray__":"exSuR+HKXEBxPQrXo+BbQFyPwvUo3FtA4XoUrkdhX0C4HoXrUeheQNejcD0Kb2BA9ihcj8JlXEDhehSuR0FdQK5H4XoU7llApHA9CtdjW0BI4XoUrgdfQM3MzMzM7F9ACtejcD3KXkDsUbgehXtcQI/C9Shcb11AXI/C9SjkYEBmZmZmZmZhQHE9CtejKGFAj8L1KFxHYUApXI/C9ShiQPYoXI/CtWJAzczMzMx8YkDNzMzMzARhQIXrUb
